              <button>Accident</button>
              <button>Hazard</button>
              <button>Traffic</button>
          <div>
            {active==="FirstCard"&& <Cards title ="Accident"></Cards> }
            {active==="2ndCard"&& <Cards title ="Hazard"></Cards> }
            {active==="3rdCard"&& <Cards title ="Traffic"></Cards> }
          </div>
          </div>                                        
    )     
}
